/* eslint-disable react/prefer-stateless-function */
import React,{useState} from "react";
import { BrowserRouter } from "react-router-dom";
import P5Wrapper from 'react-p5-wrapper';
import sketch from "./components/sketches/sketchOne.js"
import kitchen from "./components/sketches/sketchKitchen.js"
import library from "./components/sketches/sketchLibrary" 



function App() {
  const [location, setLocation] = useState({library: true, livingRoom: false, bedRoom: false, kitchen: false});
  return (
    <div>
    {location.livingRoom && <P5Wrapper sketch={sketch} />}
    {location.kitchen && <P5Wrapper sketch={kitchen} />}
    {location.kitchen && <P5Wrapper sketch={library} />}
    </div>
  );
}

export default App;
